const Preferential = () => {
  return (
    <div className="Select">
    <div className="Select_main">
    <div>
    <h1> Escolha Inteira ou 2 Sabores </h1>
    <div>
      <Link className="Sabos" to="/tipo">
            <img src={SabosImg} className="" alt="logo" />
        </Link>
        <h2> 1 Sabos </h2>
       </div>

        <div>
      <Link className="Sabores2" to="/tipo">
            <img src={SaboresImg} className="" alt="" />
        </Link>
      <h2> 2 Sabores </h2> 
       </div>
    </div>

    </div>
    </div>
  );
}

export default Preferential;
